// DesignSystem.js - Beautiful design system showcase
import React, { useState } from 'react';
import { theme } from './theme';
import Button from './components/Button';
import ChatMessage from './components/ChatMessage';
import ChatInput from './components/ChatInput';
import NavItem from './components/NavItem';

function DesignSystem() {
  const [selectedMode, setSelectedMode] = useState('Practical tools');

  const Section = ({ title, children }) => (
    <section style={{ marginBottom: '80px' }}>
      <h2 style={{
        fontFamily: theme.typography.fontFamily,
        fontSize: theme.typography.sizes['2xl'],
        fontWeight: theme.typography.weights.semibold,
        color: theme.colors.text.primary,
        marginBottom: theme.spacing[8],
        borderBottom: `2px solid ${theme.colors.border.default}`,
        paddingBottom: theme.spacing[4],
      }}>
        {title}
      </h2>
      {children}
    </section>
  );

  const ColorSwatch = ({ name, value }) => (
    <div style={{ display: 'flex', flexDirection: 'column', gap: theme.spacing[2] }}>
      <div style={{
        width: '120px',
        height: '120px',
        backgroundColor: value,
        borderRadius: theme.radius.md,
        border: `1px solid ${theme.colors.border.subtle}`,
        boxShadow: '0 2px 8px rgba(0,0,0,0.1)',
      }} />
      <div>
        <p style={{
          fontFamily: theme.typography.fontFamily,
          fontSize: theme.typography.sizes.sm,
          fontWeight: theme.typography.weights.semibold,
          color: theme.colors.text.primary,
          margin: 0,
        }}>
          {name}
        </p>
        <code style={{
          fontFamily: 'Monaco, monospace',
          fontSize: theme.typography.sizes.xs,
          color: theme.colors.text.secondary,
        }}>
          {value}
        </code>
      </div>
    </div>
  );

  return (
    <div style={{
      backgroundColor: theme.colors.surface.raised,
      minHeight: '100vh',
      padding: '60px 80px',
    }}>
      {/* Header */}
      <header style={{ marginBottom: '80px' }}>
        <h1 style={{
          fontFamily: theme.typography.fontFamily,
          fontSize: theme.typography.sizes['3xl'],
          fontWeight: theme.typography.weights.bold,
          color: theme.colors.text.primary,
          margin: 0,
          marginBottom: theme.spacing[2],
        }}>
          Nova Design System
        </h1>
        <p style={{
          fontFamily: theme.typography.fontFamily,
          fontSize: theme.typography.sizes.lg,
          color: theme.colors.text.secondary,
        }}>
          A comprehensive design system for the Nova mental health platform
        </p>
      </header>

      {/* Colors */}
      <Section title="Colors">
        <h3 style={{ marginBottom: theme.spacing[4] }}>Neutrals</h3>
        <div style={{ display: 'flex', gap: theme.spacing[6], flexWrap: 'wrap', marginBottom: theme.spacing[8] }}>
          {Object.entries(theme.colors.neutral).map(([key, value]) => (
            <ColorSwatch key={key} name={`Neutral ${key}`} value={value} />
          ))}
        </div>

        <h3 style={{ marginBottom: theme.spacing[4] }}>Text Colors</h3>
        <div style={{ display: 'flex', gap: theme.spacing[6], flexWrap: 'wrap' }}>
          {Object.entries(theme.colors.text).map(([key, value]) => (
            <ColorSwatch key={key} name={`Text ${key}`} value={value} />
          ))}
        </div>
      </Section>

      {/* Typography */}
      <Section title="Typography">
        <div style={{ display: 'flex', flexDirection: 'column', gap: theme.spacing[6] }}>
          <div>
            <h1 style={{ margin: 0, marginBottom: theme.spacing[2] }}>Heading 1</h1>
            <code style={{ fontSize: theme.typography.sizes.xs, color: theme.colors.text.secondary }}>
              32px / Semibold / Line height 1.2
            </code>
          </div>
          <div>
            <h2 style={{ margin: 0, marginBottom: theme.spacing[2] }}>Heading 2</h2>
            <code style={{ fontSize: theme.typography.sizes.xs, color: theme.colors.text.secondary }}>
              24px / Semibold / Line height 1.3
            </code>
          </div>
          <div>
            <h3 style={{ margin: 0, marginBottom: theme.spacing[2] }}>Heading 3</h3>
            <code style={{ fontSize: theme.typography.sizes.xs, color: theme.colors.text.secondary }}>
              20px / Semibold / Line height 1.5
            </code>
          </div>
          <div>
            <p style={{ margin: 0, marginBottom: theme.spacing[2] }}>Body text - The quick brown fox jumps over the lazy dog</p>
            <code style={{ fontSize: theme.typography.sizes.xs, color: theme.colors.text.secondary }}>
              16px / Regular / Line height 1.5
            </code>
          </div>
        </div>
      </Section>

      {/* Spacing */}
      <Section title="Spacing">
        <div style={{ display: 'flex', flexDirection: 'column', gap: theme.spacing[4] }}>
          {Object.entries(theme.spacing).map(([key, value]) => (
            <div key={key} style={{ display: 'flex', alignItems: 'center', gap: theme.spacing[4] }}>
              <div style={{
                width: value,
                height: '40px',
                backgroundColor: theme.colors.accent,
                borderRadius: theme.radius.sm,
              }} />
              <code style={{ fontSize: theme.typography.sizes.sm }}>
                spacing[{key}] = {value}
              </code>
            </div>
          ))}
        </div>
      </Section>

      {/* Components */}
      <Section title="Components">

        <h3 style={{ marginBottom: theme.spacing[4] }}>Navigation Items</h3>
        <div style={{ 
          display: 'flex', 
          flexDirection: 'column', 
          gap: theme.spacing[2],
          maxWidth: '250px',
          backgroundColor: theme.colors.surface.default,
          padding: theme.spacing[4],
          borderRadius: theme.radius.lg,
          marginBottom: theme.spacing[8],
        }}>
          <NavItem icon="ðŸ " label="Home" />
          <NavItem icon="ðŸ’¬" label="Chat" active={true} />
          <NavItem icon="ðŸ“…" label="Book" />
        </div>

        <h3 style={{ marginBottom: theme.spacing[4] }}>Chat Messages</h3>
        <div style={{ 
          display: 'flex', 
          flexDirection: 'column', 
          gap: theme.spacing[6],
          maxWidth: '700px',
          marginBottom: theme.spacing[8],
        }}>
          <ChatMessage 
            message="This is a user message example" 
            isUser={true} 
          />
          <ChatMessage 
            message="This is an AI response with feedback buttons" 
            isUser={false} 
            showFeedback={true}
          />
        </div>

        <h3 style={{ marginBottom: theme.spacing[4] }}>Chat Input</h3>
        <div style={{ maxWidth: '700px' }}>
          <ChatInput 
            selectedMode={selectedMode}
            onModeChange={setSelectedMode}
            onSend={(msg) => console.log('Sent:', msg)}
          />
        </div>
      </Section>
    </div>
  );
}

export default DesignSystem;
